package acm.three;

import java.util.Scanner;
//c
public class main {
	public static void main(String[] args) {
		Scanner sc =new Scanner(System.in);
		int n = sc.nextInt();
		int cost=0;
		int high=sc.nextInt();
		if(high<n)
		{
			cost=cost+(n-high);
		}
		for(int i=1;i<n;i++){
			high=sc.nextInt();
			cost=cost+Math.abs(n-i-high);
		}
		System.out.println(cost);
	}

}

