#include<stdio.h>
#include<math.h>
int panduan(int c)
{
	int i,j,sum=0;
	for(i=c-1;i>=sqrt(2)*c/2;i--)
	{
		for(j=1;j<=sqrt(2)*c/2;j++)
		{
			if(j*j+i*i==c*c)
				sum+=1;
		}
	}
	return sum;
}
main()
{
