#include<stdio.h>
#include<math.h>
int panduan(int c)
{
	int i,p,sum=0;
	float q=sqrt(2)*c/2;
	for(i=1;i<q;i++)
	{
		int p=sqrt(c*c-i*i);
		if(c*c-i*i==p*p)
			sum+=1;
	}
	return sum;
}
