public class main{
	public static void main(String[] args) {
		Scanner sc = new Scanner(System.in);
		
		int n = sc.nextInt();
		for(int i=0;i<n;i++){
			boolean flag = true;
			String s = sc.next();
			for(int j=0;j<s.length();j++){
				if(s.charAt(j)=='0'&&j>0){
					if(s.charAt(j-1)=='1')
						continue;
					else{
						flag=false;
						break;
					}
					
				}
				else if(s.charAt(j)=='6'&&j>1)
				{
					if(s.charAt(j-1)=='0'&&s.charAt(j-2)=='1'){
						continue;
					}
					else{
						flag=false;
						break;
					}
				}
				if(s.charAt(j)=='1'){
					continue;
				}
				else{
					flag=false;
					break;
				}
			}
			if(flag==true){
				System.out.println("YES");
			}
			if(flag==false){
				System.out.println("NO");
			}
		}
	}
}

import java.util.Scanner;

public class Main {
	public static void main(String[] args) {
		Scanner sc= new Scanner(System.in);
		int n = sc.nextInt();
		String[] fairs = new String[n];
		for (int i = 0; i < n; i++) {
			fairs[i] = sc.next();
		}
		for (int i = 0; i < n; i++) {
			if (fairs[i].equals("")) {
				System.out.println("NO");
			} else {
				if (help(fairs[i])) {
					System.out.println("YES");
				}else {
					System.out.println("NO");
				}
			}
		}
	}
	
	public static boolean help( String str) {
		if (str.equals("")) return true;
		boolean flag = false;
		int size = str.length();
  		char[] charArr = str.toCharArray();
		if (size >= 1 && charArr[0] == '1') {
			flag = help(str.substring(1));
		}
		if (size >= 2 &&str.substring(0, 2).equals("10")) {
			flag = help(str.substring(2));
		}
		if (size >= 3 && str.substring(0,3).equals("106")) {
			flag = help(str.substring(3));
		}
		return flag;
	}		
}

