using namespace std;
typedef long long ll;
const int N = 1010;

int n,m,cnt,a[N],num[N][2];
string s;

int main()
{
	int T;
	cin >> T;
	while(T--)
	{
		cin >> n >> m;
		int tot = 0;
		for(int i = 1;i <= n;i++)
		{
			cin >> num[i][0];
			num[i][1] = 1;
		}
		for(int i = 0;i < m;i++)
		{
			int t;
			cin >> t;
			num[t][1] = 2;
		}
		for(int i = 1;i <= n;i++)
		{
			if(num[i][0] > 1)
			{
				for(int j = 0;j < num[i][0]-1;j++)
				{
					int k = 1,t = 0,tl = -1,tr = -1,kl,kr;
					while(num[i-k][0] != 0 && i-k > 0)
					{
						t += num[i-k+1][1];
						k++;
					}
					if(num[i-k][0] == 0)
						tl = t,kl = k;
					k = 1,t = 0;
					while(num[i+k][0] != 0 && i+k <= n)
					{
						t += num[i+k-1][1];
						k++;
					}
					if(num[i+k][0] == 0)
						tr = t,kr = k;
					if(tl != -1 && tr != -1)
					{
						if(tl > tr)
						{
							tot += tr;
							num[i+kr][0] = 1;
						}
						else
						{
							tot += tl;
							num[i-kl][0] = 1;
						}
					}
					if(tl == -1)
					{
						tot += tr;
						num[i+kr][0] = 1;
					}
					if(tr == -1)
					{
						tot += tl;
						num[i-kl][0] = 1;
					}
				}
			}
		}
		cout << tot << endl;
	}
	
	return 0;
}

