#include<stdio.h>
int num[1010][2];
int main(void){
	int T;
	scanf("%d",&T);
	for(int t=0;t<T;t++){
		int all=0;
		for(int i=1;i<=1000;i++){
			num[i][1]=0;
		}
		int n,m;
		scanf("%d%d",&n,&m);
		for(int i=1;i<=n;i++){
			scanf("%d",&num[i][0]);
		}
		
		for(int i=0;i<m;i++){
			int tt;
			scanf("%d",&tt);
			num[tt][1]=1;
		}
		for(int i=1;i<=n;i++){
			if(num[i][0]>1){
				
				for(int j=0;j<num[i][0]-1;j++){
					int t1=0,tt1=0,t2=0,tt2=0,tk1=0,tk2=0,fg1 = 0,fg2 = 0;
					for(int k=1;k<=n;k++){
				//		printf("%d %d\n",num[i-k][0],num[i+k][0]);
						if(i-k>0 && fg1 == 0){
						//	printf("@%d %d %d",num[i-k][0],i-k,num[2][0]);
							t1+=num[i-k+1][1]+1;
							if(num[i-k][0]==0){
								tt1=t1;
								tk1=k;
								fg1 = 1;
						//		printf("left%d %d\n",i-k,t1);
							}
						}
						else{
							fg1 = 1;
						}
						if(i+k<=n && fg2 == 0){
							t2+=num[i+k-1][1]+1;
							if(num[i+k][0]==0){
								tt2=t2;
								tk2=k;
								fg2 = 1;
						//		printf("right%d %d\n",i+k,t2);
							}
						}
						else{
							fg2 = 1;
						}
						
						
						if(fg1 == 1 && fg2 == 1){
							break;
						}
					}
				//	printf("!!!!%d %d ",tt1,tt2);
					if(tt1!=0&&tt2!=0){
					//	printf("???%d %d\n",tt1,tt2);
						if(tt1>tt2){
							num[i+tk2][0]=1;
							all+=tt2;
						}
						else{
							num[i-tk1][0]=1;
							all+=tt1;
						}
					}
					else if(tt1==0){
						num[i+tk2][0]=1;
						all+=tt2;
					}
					else if(tt2==0){
						num[i-tk1][0]=1;
						all+=tt1;
					}
				}
			}
			num[i][0]=1;
		}
		printf("%d\n",all);		
	}
	
	return 0;
}

